import "./Login.scss";
import Logo from "../../assets/logo";

function Login() {
    return (
        <div className="login">
            <div className="image-container"></div>
            <div className="content">
                <div className="form-container">
                    <Logo />
                </div>
            </div>
            <div className="footer"></div>
        </div>
    );
}

export default Login;
